	$(document).ready(function(){
		$.fn.ccSiteFixes();
		$.fn.ccPageInit();
	});
	$(window).resize(function(){
		if(
			(
				($(window).width() < ccGLOBALS['windowwidth']-70) || 
				($(window).width() > ccGLOBALS['windowwidth']+70)
			) 
			|| 
			(
				($(window).height() < ccGLOBALS['windowheight']-70) || 
				($(window).height() > ccGLOBALS['windowheight']+70))
			)
		{
			ccGLOBALS['windowwidth'] = $(window).width();
			ccGLOBALS['windowheight'] = $(window).height();

			if($.fn.ccThrottle('globalThrottleResize',150)) {
				$.fn.ccPageResizeQuick();
			}
		}
	});
	$(window).scroll(function(){
		if($.fn.ccThrottle('globalThrottleScroll',100)) {
  			$.fn.ccPageScroll();
		}
	});


