// Add Photo Swipe Element ////////////////////////////////////
	$.fn.ccAddPhotoSwipe = function(){
		// Append Container
		$('body').prepend('<div class="pswp" tabindex="1" role="dialog" aria-hidden="true"><div class="pswp__bg"></div><div class="pswp__scroll-wrap"> <div class="pswp__container"> <div class="pswp__item"></div><div class="pswp__item"></div><div class="pswp__item"></div></div><div class="pswp__ui pswp__ui--hidden"> <div class="pswp__top-bar"> <div class="pswp__counter"></div><button class="pswp__button pswp__button--close" title="Schlieen (Esc)"><span>Schlieen (Esc)</span></button> <button class="pswp__button pswp__button--fs" title="Vollbild"><span>Vollbild</span></button> <button class="pswp__button pswp__button--zoom" title="Ein-/Auszoomen" aria-pressed="false"><span>Ein-/Auszoomen</span></button> <div class="pswp__preloader"> <div class="pswp__preloader__icn"> <div class="pswp__preloader__cut"> <div class="pswp__preloader__donut"></div></div></div></div></div><div class="pswp__share-modal pswp__share-modal--hidden pswp__single-tap"> <div class="pswp__share-tooltip"></div></div><button class="pswp__button pswp__button--arrow--left" title="Previous (arrow left)"><span>Previous (arrow left)</span> </button> <button class="pswp__button pswp__button--arrow--right" title="Next (arrow right)"><span>Next (arrow right)</span> </button> <div class="pswp__caption"> <div class="pswp__caption__center"></div></div></div></div></div>');
	
		// Init Container
		$(".photoswipe").click(function(e){
       var page = 0;
       var items = [];
       if($(this).attr('data-photoswipe-group')){
          var group = $(this).data('photoswipe-group');
          var clicked = $(this);
          $.each($(".photoswipe[data-photoswipe-group='"+group+"']"), function(index, value){

             var item = {
                src : $(value).attr('href'),
                w: parseInt($(value).data('photoswipe-width')),
                h: parseInt($(value).data('photoswipe-height')),
                title: $(value).parent().find('.cc_img_info_long').html(),
             }
             items.push(item);
             if($(value).is(clicked)) page = index;
          });
       }else{
          var item = {
             src : $(this).attr('href'),
             w: parseInt($(this).data('photoswipe-width')),
             h: parseInt($(this).data('photoswipe-height')),
             title: $(this).parent().find('.cc_img_info_long').html(),
          }
          items.push(item);
       }
       var options = {
          index: page,
          history: false,
          focus: false,
          showAnimationDuration: 0,
          hideAnimationDuration: 0
       };
       var pswpElement = document.querySelectorAll('.pswp')[0];
       var gallery = new PhotoSwipe( pswpElement, PhotoSwipeUI_Default, items, options);
       gallery.init();
       e.preventDefault();
    });

		var alreadyClicked = false;
    $('.pswp__button--zoom').click(function(){
    	if(alreadyClicked == false){
    		alreadyClicked = true;
    		$(this).attr('aria-pressed','true');
    	} else {
    		alreadyClicked = false;
    		$(this).attr('aria-pressed','false');
    	}
    });
}

// Reducts Multi Firing Events - Gunnar ////////////////////////////////////
var ccThrottleArray = [];
$.fn.ccThrottle = function (ccThrottleName,ccThrottleTimer) {
	if ((typeof ccThrottleArray[ccThrottleName]== "undefined") || (ccThrottleArray[ccThrottleName]==true)) {
			ccThrottleArray[ccThrottleName] = false;
			setTimeout(function() {ccThrottleArray[ccThrottleName] = true;},ccThrottleTimer)
			return true;
	} else {
		return false;
	}
}

$.fn.ccScrolled = function(){
	if($(window).scrollTop() > 300) {
		$('#cc_jump_top').addClass('cc_scrolled');
	} else {
		$('#cc_jump_top').removeClass('cc_scrolled');
	}
}
$.fn.ccSitemap= function(){
	if($('#cc_sitemap').length) {
		$('#cc_sitemap').parents('.cc_bg_1').removeClass('cc_bg_1').addClass('cc_bg_0');
		$('#cc_sitemap').parents('.cc_bg_2').removeClass('cc_bg_2').addClass('cc_bg_0');
		$('#cc_sitemap').parents('.cc_bg_3').removeClass('cc_bg_3').addClass('cc_bg_0');
		$('#cc_sitemap').parents('.cc_bg_4').removeClass('cc_bg_4').addClass('cc_bg_0');
		$('#cc_sitemap').parents('.cc_bg_5').removeClass('cc_bg_5').addClass('cc_bg_0');
	}
}
$.fn.ccJumpTop=function(){
	$('#cc_jump_top').click(function(e){
		e.preventDefault();
		$('html, body').animate({
	        scrollTop: 0
	    }, 1000);	
	})
}
