$.fn.ccRwdImgFit=function(elem,img,srcPath,mode) {
	img.css('opacity',0);
	elem.css('background-image','url('+srcPath+')');
	if (mode == 'w') {
		elem.addClass('cc_is_landscape');
		elem.removeClass('cc_is_portrait');
	}
	if (mode == 'h'){
		elem.addClass('cc_is_portrait');
		elem.removeClass('cc_is_landscape');
	}
}

$.fn.ccBuildUriOfImageOTF = function(size, mode, force, cropVariant, urlParams){
	var fullSrc = this.data("img-uri") || this.attr("src");
	var srcVal = fullSrc.split('?');
	var queryArgs = $.fn.ccParseQuery(srcVal[1] || '');
	if(!force && mode in queryArgs && queryArgs[mode] > size && cropVariant == (queryArgs['c']||'')) return fullSrc;
	delete queryArgs["w"];
	delete queryArgs["h"];
	delete queryArgs["c"];
	queryArgs[mode||'w'] = size;
	if(cropVariant !== '')
		queryArgs['c'] = cropVariant;
	if(urlParams !== null && typeof urlParams === 'object'){
		for(var key in urlParams){
			queryArgs[key] = urlParams[key];
		}
	}
	return (srcVal[0] + '?' + $.param(queryArgs));
};

$.fn.ccLoadImageOTF = function(size, mode, force, cropVariant){
	var deferred = new $.Deferred();
	var srcPath =  this.ccBuildUriOfImageOTF(size, mode, force, cropVariant);
	this.one("load", function(){
		deferred.resolve(srcPath);
	}).attr("src", srcPath);
	return deferred.promise();
};

$.fn.ccParseQuery = function(query){
    var result = {};
    var entries = query.split('&');
    $.each(entries, function(index, value){
    	var element = value.split('=', 2);
    	result[element[0]] = decodeURIComponent(element[1]);
	});
    return result;
};

$.fn.ccInitRwdImgAction=function(elem){
  

		// Status: Soll geladen werden?
	    var checkvisible = $.fn.ccIsOnScreen(elem);
	    var checkloadstate = elem.hasClass('cc_nolazy');
	  	if (checkloadstate) checkvisible = true;

	    if(checkvisible){ // Lazyloading, is Elem in Viewport
	        var container = elem;
			var maxRatio = 1.5;
			var ResMultiplyer = 1.1;
			if (elem.hasClass('cc_highres')) { ResMultiplyer = maxRatio;}
			ResMultiplyer = Math.min(ResMultiplyer, window.devicePixelRatio || maxRatio);
	        var img = elem.find('img');
	        var checkfit = elem.hasClass('cc_fit');
	        var fileName=img.data('orig');

	    	var cwidth = elem.width();
	        var cheight = elem.height();
	        if (cwidth >= elem.attr('width')) {ResMultiplyer = 1; }

	        var imgwidth = elem.find('img').attr('width');
	        var imgheight = elem.find('img').attr('height');

	        var resized_imgwidth = elem.find('img').width();
	        var resized_imgheight = elem.find('img').height();

	        var mode = 'w';
	        var crop = '';

	        if(checkfit){
                if($(window).width() < 600){
                    imgwidth = img.data('portrait-width') || imgwidth;
                    imgheight = img.data('portrait-height') || imgheight;
                    crop = 'portrait';
                }
                mode = cheight>=resized_imgheight?'h':'w'; //cwidth/cheight >= imgwidth/imgheight ? 'w' : 'h';
            }

            var requested_imgsize = (mode == 'h' ? (Math.ceil((container.height()*ResMultiplyer)/ccRespImageSteps)*ccRespImageSteps) : (Math.ceil((container.width()*ResMultiplyer)/ccRespImageSteps)*ccRespImageSteps));

            $.fn.ccRwdImgWrite(elem,img,"",mode,requested_imgsize,checkfit, crop);     
	 	}
};

$.fn.ccRwdImgWrite=function(elem,img,fileName,mode,imgsize,checkfit, cropVariant) {
	if (imgsize > 0) {
	    elem.removeClass('cc_pending');
		if ((imgsize >=elem.width()) && (mode == 'w')) {imgsize = elem.width();}
		if ((imgsize >=elem.height()) && (mode == 'h')) {imgsize = elem.height();}
		if ($.fn.ccCheckVar(img.attr('data-'+mode))) {} else { img.attr('data-'+mode,0)} // initialer Load
		img.ccLoadImageOTF(imgsize,mode,false,cropVariant).done(function(srcPath){
			$(this).parents('.cc_rwd_img').addClass('cc_ready');
			if (checkfit) {
				$.fn.ccRwdImgFit(elem,img,srcPath,mode);
	        }
		});

        
    }
}



