// isOnScreen
$.fn.ccIsOnScreen = function(elem){
    visible = false;
    var win = $(window);
    viewportheight = win.height();
    scrollposition = win.scrollTop();
    elemPosition = elem.offset()['top'];
    if ((viewportheight+scrollposition)>=elemPosition-300) { return true;}
};

// Check Vars exist and filled ////////////////////////////////////
$.fn.ccCheckVar = function(theVar){
	if(theVar && theVar != '' && typeof(theVar) !== "undefined" && theVar !== false){
			return true;
	}else{
			return false;
	}
}

// Reducts Multi Firing Events - Gunnar ////////////////////////////////////
var ccDebouncerArray = [];
$.fn.ccDebouncer = function (ccDebounceName,ccDebounceTimer) {
	if ((typeof ccDebouncerArray[ccDebounceName]== "undefined") || (ccDebouncerArray[ccDebounceName]==true)) {
			ccDebouncerArray[ccDebounceName] = false;
			setTimeout(function() {ccDebouncerArray[ccDebounceName] = true;},ccDebounceTimer)
			return true;
	} else {
		return false;
	}
}

// Reducts Multi Firing Events ////////////////////////////////////
$.fn.ccDebounceEvents = function(func,timeout) { 
   
   var timeoutID , timeout = timeout || 400;
   
   return function () {
      var scope = this , args = arguments;
      clearTimeout(timeoutID); 
      timeoutID = setTimeout(function() {
          func.apply( scope , Array.prototype.slice.call( args ) );
      },timeout);
   }
}

